import React from "react";
import NavBar from '../NavBar/NavBar'

const Stats = () => {   
    return (
        <div>
            <NavBar />
            <div className="playerContainer">
            <form method="post" action="/send/" enctype="multipart/form-data">
            <input type="file"></input>
</form>
            </div>
        </div>
    );
}

export default Stats;
